import React from 'react'
import './LoadingAnimation.css'

class LoadingAnimation extends React.Component{
    render() {
        let particles = []
        for(let i = 0; i < 25; i++){
            particles.push(
                <img key={i} src='http://clipart-library.com/images/ziXoyRA7T.png'/>
            )
        }
        return (
            <div>
                <h1 id="name">
                    ForkU
                </h1>
                {particles}
            </div>
        )
    }
}

export default LoadingAnimation
